export const TodoForm = () => {
  return (
    <form className="TodoForm">
    <input type="text" className="todo-input" placeholder='Descrição da
   Tarefa' />
    <button type="submit" className='todo-btn'>Adicionar Tarefa</button>
    </form>
   
  )
}
export default TodoForm;
